import React, { Component } from 'react';
import {Menu} from '../../components'
import logo from '../../img/logo.png'
import './style.css'

class Nav  extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() { 
    return (
    <>
        <div className="nav-menu">
        <div className="logo">
        <img src={logo} alt="logo-groceries"></img> 
        </div>
        <Menu>Sembako</Menu>
        <Menu>Sayuran</Menu>
        <Menu>Minuman</Menu>
        <Menu>|</Menu>
        <Menu>Masuk</Menu>
        <Menu>Daftar</Menu>
        </div>
    </>
    );
    }
}
export default Nav;
